int Pro(int in, int out, int P, int count){
    //in->out
    if( ( (in==1) && ((out==1)||(out==3)||(out==5)||(out==7)) ) ||
        ( (in==2) && ((out==2)||(out==6)||(out==8)||(out==14)) ) || 
        ( (in==4) && ((out==3)||(out==4)) ) ||
        ( (in==5) && ((out==1)||(out==4)) ) ||
        ( ((in==8)||(in==9)) && ((out==8)||(out==10)) ) ||
        ( (in==10) && ((out==2)||(out==6)) ) ||
        ( (in==11) && ((out==8)||(out==14)) ) ||
        ( (in==12) && ((out==4)||(out==7)) ) ||
        ( (in==13) && ((out==4)||(out==5)) ) ){
        P = 2*count;
        }
    else if(( (in==3) && ((out==1)||(out==3)||(out==5)||(out==7)||(out==9)||(out==11)||(out==13)||(out==15)) ) ||
            ( ((in==4)||(in==5)) && ((out==12)||(out==13)||(out==14)||(out==15)) ) ||
            ( (in==6) && ((out==1)||(out==2)||(out==5)||(out==6)||(out==10)||(out==11)||(out==12)||(out==13)) ) ||
            ( (in==7) && ((out==2)||(out==3)||(out==6)||(out==7)||(out==9)||(out==10)||(out==12)||(out==15)) ) ||
            ( ((in==8)||(in==9)||(in==10)) && ((out==9)||(out==11)||(out==13)||(out==15)) ) ||
            ( (in==11) && ((out==1)||(out==3)||(out==5)||(out==7)) ) ||
            ( ((in==12)||(in==13)) && ((out==9)||(out==11)||(out==12)||(out==14)) ) ||
            ( (in==14) && ((out==1)||(out==2)||(out==5)||(out==6)||(out==9)||(out==10)||(out==12)||(out==15)) ) ||
            ( (in==15) && ((out==2)||(out==3)||(out==6)||(out==7)||(out==10)||(out==11)||(out==12)||(out==13)) ) ){
            P = 3*count;
            }
    else{
        P = 0;
    }
    return P;
}

